import React from "react";
import { Routes } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home/Home";

function App() {
  return (
    <div>
      <Home />
      <React.Fragment>
        <Routes>
          <Route path="/mainhome" element={<Home />} />
        </Routes>
      </React.Fragment>
    </div>
  );
}

export default App;
